import './Rodape.css';

const Rodape = () => {

    const imagens = [
        {
            src: "/imagens/tw.png",
            alt: "logo Twitter"
        },
        {
            src: "/imagens/fb.png",
            alt: "logo Facebook"
        },
        {
            src: "/imagens/ig.png",
            alt: "logo Instagran"
        },
        {
            src: "/imagens/logo.png",
            alt: "logo organo"
        }
    ]

    return (
        <footer className="rodape">
            <h3>Desenvolvido por Alura.</h3>
        </footer>
    );
}

export default Rodape;
